data.text:
@chris_mcpolin Hi, if your flight has been changed, I recommend that you contact us by phone so we can check this out. You can find our contact information via this link by clicking on Customer Service/Eurobonus:
https://t.co/b3QIqPk7bj
//Henrik

@marcnoruega Hi, you can find the latest entry/transit rules for your destination at https://t.co/oj06rsDGPg - if you need more information we recommend contacting the local authorities in the transit country.

Best regards,
Anton.

@LuukDobbe Hi, we are asking you to contact customer service as we are not able to look into individual cases here on Facebook. Thank you for your understanding.

Best regards,
Anton.

@LuukDobbe Hello. Please contact us on live-chat https://t.co/b3QIqPk7bj with your case ID and we can send a reminder to Customer Care about your case.

Best regards,
Anton.

@chunks_wold Hi, all phone numbers listed on https://t.co/b3QIqPk7bj should be working during the advised opening hours. If the local number for your country does not work, please try our international phone number +46 8797 3010

Best regards,
Anton.

@Evan_Sanders Hi, if your voucher has expired, it cannot be extended. You can have a look if your voucher is refundable here: https://t.co/ui2Ls6yWKm
If not, please contact our support so we can look into what options you have for your voucher: https://t.co/b3QIqPk7bj
Kind regards, Rebecka

@bearoon Hi! You are able to bring your ski equipment as long as you are able to add it to your ticket beforehand. You can do so here: https://t.co/N5Z9cNmgWj
You can also contact us to add it for you here: https://t.co/b3QIqPk7bj
Kind regards, Rebecka

@HejaIdil Hi!

We really regret that you feel that way. If you wish to submit feedback regarding this, you can do so via our feedback form on our website at: https://t.co/Kh0HWq1mmg

Best regards / Sanna

@LuukDobbe Hello! 
Please contact us by phone so that we can send a reminder to Customer Care regarding your case. You can find our contact information here:  https://t.co/b3QIqPk7bj

Kind Regards, Anja!

@chriswoodward70 Hello
Please contacts lost and found for Arlanda, you can find their contacts here:  https://t.co/gic4yeXxSw. All items left on the flight are handled by them.

Kind regards, Anja!

@Yevgeni05797325 Hi, we are not able to look into individual cases over Twitter unfortunately. Please contact our customer service https://t.co/b3QIqPk7bj with your case ID and they can send a reminder to the case handler for you.

Best regards,
Anton.

@lucagrazzini Hello, please contact customer service on live-chat/phone https://t.co/b3QIqPk7bj at least 24 hours before departure and they can help you book gluten free meal.

Best regards,
Anton.

@leiss93 Hi, it depends on which lounges that is open when you fly. If the ordinary lounge is closed then you use the gold lounge but you use the ordinary lounge if that is open at the time of travel.

Regards, 
Peter

@TheSoccerDucks Hello! 
SAS plans the trips for approximately 300-330 days in advance. This means that the flights we have currently planned are published on our website. You can search for trips here: https://t.co/BlgfvicYhk

Kind regards, Anja!

@Handinamic Hi! 

No it's sadly not possible to transfer your loyalty status from another airline to ours. 

//Best regards, Dennis.

@RS_Belfast Hi! 

Yes you can go to our website https://t.co/saQXo2wpQa and click on my bookings and then request a refund for your trip.

//Best regards, Dennis.

@AbbeRyden Hej
Vi är glada att du är intresserad av att praktisera hos oss.  Det är tyvärr en mycket begränsad möjlighet att ta emot praktikanter i nuläget så därför måste vi tacka nej till dessa förfrågningar men vi önskar dig lycka till i sökandet av en praktikplats.  
Hälsningar Anja!

@HalfSickShadows Hello!
Yes we do, but the number is limited per flight. If you are traveling with animals, we recommend that you pre-book the animal ticket as early as possible.

Kind regards, Anja!

@IfigeniaSuisse Hello!

You can contact us via facebook messenger or our live-chat via the website if you can not get through to the phone at the moment and we will help you there! https://t.co/b3QIqPk7bj

Best Regards, Emilia

@tanya_toner Hi, please try clearing cache/cookies in your web browser and make sure that you are not using a VPN or proxy connection when rebooking. If the problem persists - please call our support on the phone for assistance with booking https://t.co/b3QIqPk7bj

Best Regards,
Anton.

@Steve49988934 Hi, you can find our live-chat service at https://t.co/b3QIqPk7bj by clicking on the Turi icon in the bottom left corner of the webpage.

Best regards,
Anton.

@Wrightyp5 Hi, we are planning to fly direct flights daily between BHX - CPH from the end of March 2022 and onward.

Best regards,
Anton.

@Captsx1 Hi, please contact our customer service on the live-chat or phone https://t.co/b3QIqPk7bj and they can help you move the original seats to your new flight(s).

Best regards,
Anton.

@holstiie Hej, ungdomsbiljett i Go Smart får fortsatt ta med handbagage utan extra kostnad. Denna ändring gäller endast för Go Light biljetterna där det sedan 14 december inte längre ingår handbagage i biljettpriset https://t.co/of1cdsLtwa

Med vänlig hälsning,
Anton.

@mariascani0 Hi, I'm sorry to hear that your baggage is delayed. If you are still missing the baggage please contact SAS Baggage Service for LAX airport for support. Phone numbers are listed on https://t.co/ZV9bTO3uo2

Best regards,
Anton.

@beccachurm Hi, if there is a long phone queue you can contact our support via chat with the booking reference so they look at it https://t.co/b3QIqPk7bj

Regards,
Peter

@LuukDobbe Hi, Please contact our support by chat or phone with the case ID. They can then send e notification to the customer care department and ask them to look at the case.

Regards, 
Peter

@futureoffrance0 Hi, It is unfortunately not possible to travel with a rabbit in the cabin. Only cats and dogs are possible to bring into the cabin. 

Regards,
Peter

@woldingen Hej, du kan kontakta vår support via chat eller vår messenger när det är långa köer på telefon. https://t.co/cIkJt9kPnF

Hälsningar,
Peter

@Steve49988934 Hi, you contact our support by chat or phone. They can assist you with changing the phone number manually in the account.  https://t.co/b3QIqPk7bj

Regards,
Peter

@nomnom_story Hej, du kontaktar vår support via chat eller telefon för att avboka när alternativet inte visas på hemsidan.    https://t.co/z4gOZAAJQJ

Hälsningar,
Peter

@mucahidfc Hi! 

The voucher you receive should not be connected to anyone, so you can book the new trip for somebody else if you want to. 

//Best regards, Dennis.

@Hairam16 Hi! 

We apologize for the unusually long waiting times right now and we are doing everything we can to improve the situation. We sadly can't see the exact price for that from here, so you need to call us in that case.

//Best regards, Dennis.

@eviatgers Hi, you can contact our live-chat support on https://t.co/b3QIqPk7bj or contact us using the Facebook Messenger app with your booking details and we can help you take a look at the refund case.

Best regards,
Anton.

@Avogadr59624763 Hi! 

Yes there is sadly a few restrictions on that route right now. These rules can change pretty quickly so we usually recommend that our travelers contacts the embassy for the country you are traveling to in order to get the latest information.

//Best regards, Dennis.

@riley_globetrtr Hi! 

You should be able to add a meal if you go to https://t.co/saQXo2wpQa and click on my bookings. But if you can't see that alternative then i recommend that you contact our customer service via chat/messenger or phone so we can help you.

//Best regards, Dennis.

@Xacuti123 Hi, i can not look at a booking here on twitter, but depending on how the ticket is booked it might sometimes not be possible to add baggage through the homepage. In these cases it is our phone support that need to look at the possibility to add the baggage.

Regards,
Peter

@torinielsen Hej, Vi kan tyvärr inte se på bokningar eller ärenden här via twitter så jag kan inte kolla vad som skett i detta fall eller vilka möjliga lösningar som finns. Det är våra kollegor på supporten som har möjlighet att svara på det. 

Hälsningar,
Peter

@kBarn84 Hi, bag drop usually opens 3-4 hours before departure,  but it is decided locally at each airport so it can vary depending on the staffing at the day of departure.

Regards,
Peter

@Amandaxxl0808 Hi,  you contact baggage service for the airport you landed on to get assistance with tracking and delivery of the bag. The phone numbers can be found on this link  https://t.co/ZV9bTO3uo2

Regards,
Peter

@Cliff_Fietzek Hi!
Please contact us by messenger or customer service so we can check your booking.

Regards, Liv

@dapperdashy Hi Damon
Go to Terminal 5 
Kind regards /Anna

@AbberNatalie Hi, if you re unable to cancel your flight via our website: https://t.co/yZoPBVnDMr you will need to call us or chat over the live chat if it's urgent: https://t.co/b3QIqPk7bj
or contact us over Facebook Messenger for further assistance. 
Kind regards, Rebecka

@KaushikRam25 Hi! 

Okay, yes you can try this link: https://t.co/7yf4NEzz8c

//Best regards, Dennis.

@KaushikRam25 Hi! 

Yes we have flights from Warsaw to LA in that period, around the same price as well. You can have a look at our low fare calendar for a better look. 

//Best regards, Dennis.

@GaleanoGomez94 Hi, I can unfortunately not look at bookings here on Twitter. Please contact our support via chat or email with the booking reference so they can check the booking. https://t.co/b3QIqPk7bj

Regards,
Peter

@monikapiwowarc3 I am very sorry that your flight got cancelled. In order for us to be able to help you with your booking, you need to call us. You can find our contact information via this link by clicking Customer Service/Eurobonus: https://t.co/b3QIqPk7bj. 

Kind regards 
Jennie

@LuukDobbe Unfortunately, there is no telephone number for Customer Care. If you are still waiting for an answer, please contact us by our chat support on our website https://t.co/BlgfvicYhk and ask my colleagues to send a reminder to Customer Care regarding your case. 

Kind Regards
Jennie
